import React from 'react'
import axios from 'axios';

const ButtonText = () => {
  const handlerClick = () => {
    axios
      .get('')
      .then((response) => {
        console.log(response.data)
      })
      .catch()
  };

  return (
    <button onClick={handlerClick}>Получить данные</button>
  )
}

export default ButtonText
